import React from "react";

function CoinModal(props) {
  return (
    <div className="modal">
      <div className="modal__inner">
        <button className="modal__close-btn">close</button>
        {props.children}
      </div>

      <p>I am the Coin Modal</p>
    </div>
  );
}

export default CoinModal;
